import * as React from "react";
import Box from "@mui/material/Box";
import { Typography } from "@mui/material";

function Footer() {
  return (
    <>
      <Box component="main" sx={{ p: 3, mt: 8 }}>
   <Typography textAlign="center"></Typography>
      </Box>
    </>
  );
}
export default Footer;
